(1170, 248, 'description', 'Teasé par un EP appelé « Stargazing » et le single leader “It Ain’t Me” featuring Selena Gomez, “Kids In Love” est un album un brin mélancolique qui se mêle parfaitement à la saison. Après le succès de Cloud Nine sur sur lequel figurait déjà de nombreux tubes, “Kids In Love” propose de nombreuses collaborations. À la fois taillé pour les clubbers et les rêveurs, l’album propose une electropop en or. '),
